import React, { useState } from "react";
import image from "../assets/me.jpeg";
import "./Body.css";
import PageAboutMe from "./PageAboutMe";
import PageCharacterList from "./PageCharacterList";
import PageToDo from "./PageToDo";
import PageContact from "./PageContact";
import name from "./TextNameSurname";
import aboutMe from "./TextAboutMe.js";
import contact from "./TextContact";

const Body = (props) => {
  return (
    <div>
      <PageAboutMe image={image} name={name} cv={aboutMe} />
      <PageCharacterList />
      <PageToDo />
      <PageContact contact={contact} />
    </div>
  );
};

export default Body;
